import logo from './logo.png';
import coffee from './coffee.png';
import './App.css';
import Navbar from './navbar';
import NavbarBottom from './bottomBar';
import Quiz from './quiz';
import Shop from './shop';
import Order from './order';
import Confirmation from './confirmation';
import {BrowserRouter as Router, Route, Switch } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <div class ="content">
          <h1>Beanz</h1>
          <h2>Get coffee in the comfort of your own home without ever having to leave</h2>
          <h2>Working from home? No Problem</h2>
          <img src={coffee} width= "450px" height="450px" alt="coffee"></img>

          <h2>Hours: We never close!</h2> 
          <h2>Location: 12 Road, Ottawa, ON CA</h2> 
          <h2>Phone Number: 222-222-222</h2>
          <Switch>
            <Route path = "/shop">
              <Shop/>
            </Route>
            <Route path = "/order">
              <Shop/>
            </Route>
            <Route path = "/confirmation">
              <Confirmation/>
            </Route>
            <Route path = "/quiz">
              <Quiz/>
            </Route>


          </Switch>

        </div>

        <NavbarBottom />
      </div>
    </Router>    
  );
}

export default App;
